import React from "react";
import ProgressBar from "react-bootstrap/ProgressBar";

import X1Games from "./games";

const Progress = () => (
  <>
    {X1Games.map((game, key) => (
      <div key={key}>
        <h2>{game.name}</h2>
        <ProgressBar now={game.maxGamerscore - game.currentGamerscore} />
      </div>
    ))}
  </>
);

export default Progress;
